import { Heading,Box } from "@chakra-ui/react"
import { BookList } from "./components/BookList";
import { AddBook } from "./components/AddBook";

function App() {
  return (
    <div className="App">
     <Box maxW="sm" m={8} borderWidth="0px" borderRadius="lg" overflow="hidden">
      <Heading as="h2" size="3xl" mb={4} isTruncated>
        Reading List 
        </Heading>
        <BookList/>
        <AddBook/>
        </Box>
    </div>
  );
}

export default App;
